('LIDER IT', 'LIDER IT nace en el año 1985 como respuesta a las necesidades crecientes de las empresas en el ámbito de la informática.\r\nCon delegaciones en las provincias de Albacete, Alicante, Asturias, Cantabria, Barcelona, León, Lleida, Madrid, Sevilla, Valencia y Valladolid, disponemos de una plantilla de más de 200 profesionales altamente cualificados que nos permiten dar soluciones a nuestros clientes.\r\n\r\nNuestra empresa dispone de multitud de certificaciones que acreditan nuestro saber hacer en diferentes tecnologías. A su vez destacamos la certificación de nuestra empresa en las prestigiosas normas ISO 9.001, ISO 20.000 e ISO 27.001, así como el certificado de conformidad con el Esquema Nacional de Seguridad'),
